import React from 'react';

const DashboardPage = () => {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-2xl font-bold">Dashboard</h1>
            <p>View analytics and history.</p>
        </div>
    );
};

export default DashboardPage;
